import kfp
from kfp.v2 import dsl
from kfp.v2.dsl import *
from typing import *

def build_preprocessing_query_parameters(
    training_fraction: float = 0,
    validation_fraction: float = 0,
    window_stride_length: int = 1,
    window_max_count: int = int(1e8),
    row_count: int = 1,
) -> list:  # pylint: disable=g-bare-generic
  """Creates configuration JSON objects for the split column query.

  All query parameters will be stored in a list of QueryParameter objects:
  https://cloud.google.com/bigquery/docs/reference/rest/v2/QueryParameter

  Args:
    training_fraction: Fraction of the data to use for training.
    validation_fraction: Fraction of the data to use for validation.
    window_stride_length: Period to use when selecting test samples to map to
      evaluation windows. A stride of 1 will result in one window per timestamp.
    window_max_count: Maximum number of windows across the entire dataset. Used
      to determine the frequency to sample the test data when creating windows.
    row_count: The number of rows in the dataset.

  Returns:
    A list of QueryParameters.
  """
  return [
      {
          'name': 'train_percent',
          'parameterType': {
              'type': 'INTEGER'
          },
          'parameterValue': {
              'value': str(int(training_fraction * 100))
          },
      },
      {
          'name': 'validation_percent',
          'parameterType': {
              'type': 'INTEGER'
          },
          'parameterValue': {
              'value':
                  str(int((training_fraction + validation_fraction) * 100)),
          },
      },
      {
          'name': 'window_stride',
          'parameterType': {
              'type': 'INTEGER'
          },
          'parameterValue': {
              'value': str(window_stride_length or 1)
          },
      },
      {
          'name': 'window_freq',
          'parameterType': {
              'type': 'FLOAT'
          },
          'parameterValue': {
              'value':
                  str(
                      min(1.0,
                          (window_max_count or int(1e8)) / row_count)),
          },
      },
  ]

import kfp
from kfp.v2 import dsl
from kfp.v2.dsl import *
from typing import *

def parse_data_source(
    data_source_csv_filenames: Optional[str] = None,
    data_source_bigquery_table_path: Optional[str] = None,
) -> NamedTuple('Outputs', [
    ('data_source_bigquery_table_path', str),
    ('data_source_csv_filenames', list),
]):
  """Converts the data source JSON into flat arguments."""
  # pylint: disable=g-import-not-at-top,import-outside-toplevel
  import collections
  import re
  # pylint: enable=g-import-not-at-top,import-outside-toplevel

  result = {
      'data_source_csv_filenames': data_source_csv_filenames,
      'data_source_bigquery_table_path': data_source_bigquery_table_path,
  }
  for k, v in list(result.items()):
    is_optional = any([
        v is None,
        isinstance(v, str) and v in {'', '-'},
    ])
    if is_optional:
      result.pop(k)
  if 'data_source_bigquery_table_path' in result:
    result['data_source_bigquery_table_path'] = re.sub(
        '^bq://', '', result['data_source_bigquery_table_path'])
  if 'data_source_csv_filenames' in result:
    result['data_source_csv_filenames'] = [
        filename.strip() for filename in data_source_csv_filenames.split(',')]
  return collections.namedtuple('Outputs', [
      'data_source_bigquery_table_path',
      'data_source_csv_filenames',
  ])(
      result.get('data_source_bigquery_table_path', ''),
      result.get('data_source_csv_filenames', []),
  )
